import './App.css';
import { BrowserRouter, Routes } from "react-router-dom";
import MainIndex from './MainIndex';


function App() {
  return (
    <BrowserRouter>
      <div className="todo-container">
        <Routes path="/" component={MainIndex} />
      </div>
    </BrowserRouter>
  );
}

export default App;
